  ];
  return (
    <div className='container'>
      <div className='row'>
        <div className='col-2'>col1</div>
        <div className='col-2'>col1</div>
        <div className='col-2'>col1</div>
        <div className='col-2'>col1</div>
        <div className='col-2'>col1</div>
        <div className='col-2'>col1</div>
        <div className='col-2'>col1</div>
      </div>
      {!manga && <button type='button' className='btn btn-lg btn-success' onClick={() => setManga()}>Save Manga</button>}
    </div>
  );
}

export default App;
